import React from 'react'
import { useState } from 'react'
import { NavLink} from 'react-router-dom'
import { ReactComponent as Hamburger } from '../../assets/hamburguerIcon.svg'
import './navbar.css'

const Navbar = () => {
  const [showNavbar, setShowNavbar] = useState(false)

  const handleShowNavbar = () => {
    setShowNavbar(!showNavbar)
  }

    // Estado para controlar la visibilidad del popup
    const [isPopupOpenRegistro, setPopupOpenRegistro] = useState(false);

    // Funci贸n para abrir el popup
    const openPopupRegistro = () => {
      setPopupOpenRegistro(true);
    };

    // Funci贸n para cerrar el popup
    const closePopupRegistro = () => {
      setPopupOpenRegistro(false);
    };

  return (
    <nav className="navbar">
      <div className="container">
        <div className="logo">
          LOGO
        </div>
        <div className="menu-icon" onClick={handleShowNavbar}>
          <Hamburger />
        </div>
        <div className={`nav-elements  ${showNavbar && 'active'}`}>
          <ul>
            <li>
              <NavLink to="/">Inicio</NavLink>
            </li>
            <li>
              <NavLink to="/agregar">Agregar</NavLink>
            </li>
            <li>
              <NavLink to="/buscar">Buscar</NavLink>
            </li>
            <li>
              <NavLink to="/stats">Stats</NavLink>
            </li>
            <li>
              <a href='#acerca'>Acerca</a> 
            </li>
            <li>
              <button onClick={openPopupRegistro} id='iniciarBtn'>Iniciar sesi贸n</button>
            </li>
            <li>
              <button  id='registrarBtn'>Registrarme</button>
            </li>
          </ul>
          {isPopupOpen && (
        <div className="ventana-popup">
          <div className="contenido-popup">
            <form>
              <label htmlFor="email">Email</label>
              <input type="email" id="email" />
              <label htmlFor="password">Contrase帽a</label>
              <input type="password" id="password" />
              <button>Iniciar sesi贸n</button>
            </form>
            <button onClick={closePopupRegistro}>Cerrar</button>
          </div>
        </div>
      )}
        </div>
      </div>
    </nav>
  )
}

